volatile Bool fft_interrupt_flag = FALSE; 

void FFT_IRQHandler(void);
static void ifft_test(void);
static void fft_test(void);
static void fbank_all_func_test(void);
static void system_clock_init(void);
static void uart_init(void);
static void fbank_init();
static void sqrt_test(void);
static void mel_test(void);
static void log_test(void);


void main(void)
{
    printf_output_redirect_set(PRINTF_RETARGET_NONE);

    /* Reset all peripherals except PMU */
    RCC_Peri_Rst(0xFFFFFFFF & (~(RCC_PMU_PRSTN | RCC_GPIO_RSTN)));

    /* Enable N307 Interrupt */
    __enable_irq();
    __enable_mcycle_counter();
  
    printf_output_redirect_set(PRINTF_RETARGET_SEGGER);
  
    /* Initial clock */
    system_clock_init();

    /* Initial periphral */
    uart_init();
    printf_output_redirect_set(PRINTF_RETARGET_UART0);

    /* Show message */
    printf("BUILD: %s %s \r\n", __DATE__, __TIME__);
    fbank_init();
    /* periphral config */
    log_test();
    mel_test();
    sqrt_test();
    fft_test();
    ifft_test();
    fbank_all_func_test();

    /* Demo complete */
    printf("Demo complete \r\n");

    while(1){};
}

static void fbank_init()
{
    RCC_CLK_EN_Ctl(RCC_FFT_CLKEN,ENABLE);

    ECLIC_ClearPendingIRQ(FBANK_IRQn);  
    ECLIC_SetPriorityIRQ(FBANK_IRQn, 1);
    ECLIC_SetTrigIRQ(FBANK_IRQn, ECLIC_POSTIVE_EDGE_TRIGGER);
    ECLIC_EnableIRQ(FBANK_IRQn);

    FBANK_Set_Interrupt_Cmd(FBANK,FBANK_INT,ENABLE);
}

void FFT_IRQHandler(void)
{
    FBANK_Clear_Interrupt_Cmd(FBANK,FBANK_INT);
    fft_interrupt_flag = TRUE;
}

static void uart_init(void)
{
    /*init uart*/
    UART_InitTypeDef USART_InitStructure;
    GPIO_InitTypeDef GPIO_InitStructure;
    RCC_CLK_EN_Ctl(RCC_UART0_CLKEN,ENABLE);
   
    GPIO_InitStructure.Pin = GPIO_PIN_16 | GPIO_PIN_17;
    GPIO_InitStructure.Alternate = GPIO_AF16_UART0 | GPIO_AF17_UART0;
    GPIO_Init(GPIOA, &GPIO_InitStructure);
  
    USART_InitStructure.BaudRate = 9600;
    USART_InitStructure.Parity = UART_PARITY_NONE;
    USART_InitStructure.StopBits = UART_STOPBITS_1;
    USART_InitStructure.WordLength = UART_WORDLENGTH_8B;
    USART_InitStructure.Mode = UART_MODE_UART;
    USART_InitStructure.FIFOCtl = DISABLE;
    UART_Init(UART0, &USART_InitStructure);
}

/* input 40 64bit data each 64bit data use low 16bit calculate log,output 40 8bit data,each 8 8bit data combin 64bit in ram */
static int log_calculate(uint32_t *input_data, uint32_t *output_data)
{
    FBANK_Ctl_Cmd(FBANK, 0xffff, DISABLE);
    FBANK_Ctl_Cmd(FBANK, LOG_ENABLE, ENABLE);
    FBANK_Ctl_Cmd(FBANK, DATA_SRAM_SEL, ENABLE);
    FBANK_Ctl_Cmd(FBANK, SRAM_ADDR_SEL, DISABLE);
    FBANK_Write_Sram_Data(FBANK, input_data, 80);
    
    FBANK_Ctl_Cmd(FBANK, DATA_SRAM_SEL, DISABLE);
    FBANK_Enable_Cmd(FBANK, ENABLE);
    while(!fft_interrupt_flag);
    fft_interrupt_flag = FALSE;
    
    FBANK_Ctl_Cmd(FBANK, DATA_SRAM_SEL, ENABLE);
    FBANK_Ctl_Cmd(FBANK, SRAM_ADDR_SEL, DISABLE);
    FBANK_Read_Sram_Data(FBANK, output_data, 10);
     
    return 0;
}

static void log_test(void)
{
    int check_flag = 0;
    uint32_t temp[10]; 

    memset(temp,0,sizeof(temp));
    
    log_calculate(log_i, temp);

    for (int j = 0; j < 10; j++) {
        if((temp[j]&0xff) != log_o[j*4]) {
            printf("err1 %d : 0x%02x  except : 0x%02x\n", j*4, temp[j]&0xff,log_o[j*4]);
            check_flag = 1;
        }

        if(((temp[j]&0xff00) >> 8) != log_o[j*4+1]) {
            printf("err2 %d : 0x%02x  except : 0x%02x\n", j*4+1, ((temp[j]&0xff00)>>8),log_o[j*4+1]);
            check_flag = 1;
        }

        if(((temp[j]&0xff0000) >> 16) != log_o[j*4+2]) {
            printf("err3 %d : 0x%02x  except : 0x%02x\n", j*4+2, ((temp[j]&0xff0000)>>16),log_o[j*4+2]);
            check_flag = 1;
        }
        if(((temp[j]&0xff000000) >> 24) != log_o[j*4+3]) {
            printf("err4 %d : 0x%02x  except : 0x%02x\n", j*4+3, ((temp[j]&0xff000000)>>24),log_o[j*4+3]);
            check_flag = 1;
        }
    }

    if (check_flag == 0) {
        printf("log program successful!!! \r\n");
    } else {
        printf("log program failed!!! \r\n");
    }
}

/* input 256 64bit data each 64bit data use high 32bit >> 16 and low 32bit >> 16 calculate sqrt,output each 256 16bit data in 64bit ram */
static int sqrt_calculate(uint32_t *input_data, uint32_t *output_data)
{
    FBANK_Ctl_Cmd(FBANK, 0xffff, DISABLE);
    FBANK_Ctl_Cmd(FBANK, SQRT_ENABLE, ENABLE);
    FBANK_Ctl_Cmd(FBANK, DATA_SRAM_SEL, ENABLE);
    FBANK_Ctl_Cmd(FBANK, SRAM_ADDR_SEL, DISABLE);
    FBANK_Write_Sram_Data(FBANK, input_data, 512);
    
    FBANK_Ctl_Cmd(FBANK, DATA_SRAM_SEL, DISABLE);
    FBANK_Enable_Cmd(FBANK, ENABLE);
    while(!fft_interrupt_flag);
    fft_interrupt_flag = FALSE;
    
    FBANK_Ctl_Cmd(FBANK, DATA_SRAM_SEL, ENABLE);
    FBANK_Ctl_Cmd(FBANK, SRAM_ADDR_SEL, DISABLE);
    FBANK_Read_Sram_Data(FBANK, output_data, 512);

    return 0;
}

static void sqrt_test(void)
{
    int check_flag = 0;
    uint32_t temp[512] = {0};  

    memset(temp,0,sizeof(temp));
     
    sqrt_calculate(sqrt_i, temp);

    for (int j = 0; j < 256; j++) {
        if (temp[j*2] != sqrt_o[j]) {
            printf("err %d : 0x%08x  except : 0x%08x\n", j, temp[j*2],sqrt_o[j]);
            check_flag = 1;
        }
    }

    if (check_flag == 0) {
        printf("sqrt program successful!!! \r\n");
    } else {
        printf("sqrt program failed!!! \r\n");
    }
}

